$(document).ready(function(){
  $('#prov').append('<option value="">&#35831;&#36873;&#25321;&#30465;</option>');
  $('#city').append('<option value="">&#35831;&#36873;&#25321;&#24066;</option>');
  $('#county').append('<option value="">&#35831;&#36873;&#25321;&#21306;&#21439;</option>');

  var p_id;
  var c_id;
  $.each(prov, function(i, n){
    var sel = '';
	if(addr.indexOf(n.areaName)>-1) {
		p_id = n.id;
		sel = ' selected="selected"';
		$('#city').show();
		$('#address').val(n.areaName);
		$('#pros').val(n.areaName);
	}
    $('#prov').append('<option value="' + n.id +'"'+sel+' >' + n.areaName + '</option>');
	
  });

  
  $.each(city, function(i,n){
    if(p_id && n.parentAreaId==p_id){
        var sel = ''; 
        if(addr.indexOf(n.areaName)>-1) {
			c_id = n.id;
			sel = 'selected="selected"';
			$('#county').show();
			$('#address').val($('#pros').val() + n.areaName);
			$('#citys').val(n.areaName);
		}
        $('#city').append('<option value="' + n.id +'"'+sel+' >' + n.areaName + '</option>');

    }
  });

  $.each(county, function(i,n){
    if(c_id && n.parentAreaId==c_id){
        var sel = '';
        if(addr.indexOf(n.areaName)>-1) {
			sel = 'selected="selected"';
			$('#address').val($('#pros').val() + $('#citys').val() + n.areaName);
			$('#countys').val(n.areaName);
		}
        $('#county').append('<option value="' + n.id +'"'+sel+' >' + n.areaName + '</option>');
		
    }
  });


 

  $('#prov').change(function(){
	$('#county').hide();
    var tVal = $('#prov').val();
    if(tVal != ''){
        $('#city').empty();
        $('#city').append('<option value="">&#35831;&#36873;&#25321;&#24066;</option>');

        $.each(city, function(i,n){
            if(n.parentAreaId==tVal){
                $('#city').append('<option value="' + n.id + '" >' + n.areaName + '</option>');
            }
        });
        $('#address').val($("#prov option:selected").text());
		$('#pros').val($("#prov option:selected").text());
		$('#citys').val("");
		$('#countrys').val("");
    }
    $('#city').show();
  });

  $('#city').change(function(){
	$('#county').hide();
    var tVal = $('#city').val();
    if(tVal != ''){
        $('#county').empty();
        $('#county').append('<option value="">&#35831;&#36873;&#25321;&#21306;&#21439;</option>');
        tVal = parseInt(tVal);
        var c_county = 0;
        $.each(county, function(i,n){
            if(n.parentAreaId==tVal){
                c_county = c_county + 1;
                $('#county').append('<option value="' + n.id + '" >' + n.areaName + '</option>');
            }
        });
    }
    var address = $("#prov option:selected").text();
    var new_address = address + $("#city option:selected").text();
    if(c_county>=1)
		$('#county').show();
    $('#address').val(new_address);
	$('#citys').val($("#city option:selected").text());
	$('#countrys').val("");
  });

  $('#county').change(function(){
    var address = $("#prov option:selected").text();
    address += $("#city option:selected").text();
    new_address = address + $("#county option:selected").text();
    $('#address').val(address + $("#county option:selected").text());
	$('#countrys').val($("#county option:selected").text());
  });


});
